      "value": "Licensed Health Care Practitioner is:\n• a physician as defined in section 1861(r)(1) of the Social Security Act; or\n• a Registered Nurse; or\n• a Licensed Social Worker.\nThe Licensed Health Care Practitioner must not be a member of your Family. Nor can the Licensed Health Care Practitioner nor any member of the Licensed Health Care Practitioner’s Family be an owner or in any way control the operation of a facility in which you receive care or treatment.",
