      "name": "Nursing Home (definition)",
      "value": "Nursing Home is a facility or a distinctly separate part of a hospital or other institution which:\n• is licensed by the appropriate licensing agency to engage primarily in providing nursing care and related services to inpatients; and\n• provides 24-hour a day nursing service; and\n• has a nurse on duty or on call at all times; and\n• maintains clinical records for all patients.\n\nNursing Home does not include:\n• facilities or parts thereof used or licensed as an Assisted Living Facility; or\n• convalescent homes, board and rest homes, homes for the aged, residential care facilities, domiciliary and retirement care facilities, or training centers; or\n• government or veterans facilities or any other facility where the patient is not required to pay.",
